import React, { useState, useEffect } from 'react';
import { useLocation, useNavigate } from 'react-router-dom';
import axios from 'axios';
import '../App.css'; 

const SurveyData = () => {
  const [mobileNumber, setMobileNumber] = useState(''); // Added useState for mobileNumber
  const [userData, setUserData] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');
  const location = useLocation();
  const navigate = useNavigate();

  // Fetch user data when component mounts or mobile number changes
  useEffect(() => {
    // Get mobile number from navigation state
    const passedMobile = location.state?.mobileNumber;
    if (passedMobile) {
      setMobileNumber(passedMobile);
      fetchUserData(passedMobile);
    }
  }, [location.state]);

  const fetchUserData = async (mobile) => {
    setLoading(true);
    setError('');
    try {
      const response = await axios.post(
        'https://babralaapi-d3fpaphrckejgdd5.centralindia-01.azurewebsites.net/auth/getUserDetails', // Adjust endpoint as needed
        { mobileNumber: mobile },
        {
          headers: {
            'Content-Type': 'application/json'
          }
        }
      );

      if (response.data.success) {
        setUserData(response.data.user);
      } else {
        setError('User data not found');
      }
    } catch (err) {
      setError('Failed to fetch user data');
      console.error(err);
    } finally {
      setLoading(false);
    }
  };

  // Handle mobile number input change
  const handleMobileChange = (e) => {
    const newMobile = e.target.value;
    setMobileNumber(newMobile);
  };

  // Handle form submission to fetch new data
  const handleSubmit = (e) => {
    e.preventDefault();
    if (mobileNumber) {
      fetchUserData(mobileNumber);
    }
  };

  // Handle going back to users list
  const handleBack = () => {
    navigate('/');
  };

  return (
    <div className="survey-data-container">
      <h1>User Survey Data</h1>

      {/* Mobile Number Input */}
      <div className="mobile-input-section">
        <form onSubmit={handleSubmit}>
          <input
            type="text"
            value={mobileNumber}
            onChange={handleMobileChange}
            placeholder="Enter mobile number"
            className="mobile-input"
            disabled={loading}
          />
          <button 
            type="submit" 
            className="fetch-button"
            disabled={loading || !mobileNumber}
          >
            {loading ? 'Loading...' : 'Fetch Data'}
          </button>
          <button 
            type="button" 
            className="back-button"
            onClick={handleBack}
            disabled={loading}
          >
            Back to List
          </button>
        </form>
      </div>

      {/* Status Messages */}
      {loading && <div className="loading">Loading user data...</div>}
      {error && <div className="error">{error}</div>}

      {/* User Data Display */}
      {userData && !loading && (
        <div className="user-data">
          <h2>User Details</h2>
          <div className="data-field">
            <span>Mobile Number:</span> {mobileNumber}
          </div>
          <div className="data-field">
            <span>Username:</span> {userData.username}
          </div>
          <div className="data-field">
            <span>Email:</span> {userData.emailID}
          </div>
          <div className="data-field">
            <span>Roles:</span> {userData.roles.join(', ') || 'No roles'}
          </div>
          <div className="data-field">
            <span>Admin Status:</span> {userData.isAdmin ? 'Yes' : 'No'}
          </div>
          <div className="data-field">
            <span>Active Status:</span> {userData.isActive ? 'Yes' : 'No'}
          </div>
        </div>
      )}

      {!userData && !loading && !error && (
        <div className="no-data">Enter a mobile number to fetch user data</div>
      )}
    </div>
  );
};

export default SurveyData;
